
//ajout d'article
$("#formArticle").submit(function (event) {

    var article = new Object();
    var user = new Object();
    var picture = $('input[name="fileInput"]')[0].files[0];

    user.id = 2;
    article.title = $("#title").val();
    article.keywords = $("#tag").val();
    article.content = $("#content").val();
    article.status = "WAITFORVALIDATION";
    article.a_ecrit = user;
    article.photo = convertFileToBase64(picture);
    //article.photo = 'data:image/jpeg;base64,';

    console.log("article :    " + JSON.stringify(article));

    event.preventDefault();
    ajouterArticle(article);
});

